import { HTMLMorph, inspect } from "lively.morphic";
import * as vis from "https://lively-web.org/users/MattH/uploads/vis.js"
import { deepCopy } from "lively.lang/object.js";
import L2LClient from "lively.2lively/client.js";

import WebDAVResource from "lively.resources/src/http-resource.js";
import { loadObjectFromPartsbinFolder } from "lively.morphic/partsbin.js";

export default class VisjsMorph extends HTMLMorph {
  static get properties(){
    return {
      raw: {
        nodes: null,
        edges: null
      }
    }
  }

  async onLoad(){
    this.setupL2L();
    this.loadGraph();
    var self = this;
    var roomContents = await this.checkRoom('visRoom')    
    if (roomContents.data.length >= 1){
      this.getState('visRoom',roomContents.data.length)
      function waitAndTest(list,len){
        setTimeout(function(){
          if(list.length == len){
            console.log(self.clientList)
            return
          } else {            
            waitAndTest(list,len)
          }
        },100)
      }
      waitAndTest(this.clientList,(roomContents.data.length -1))
    }


  }

  async loadGraph() {

      this.viscanvasId = 'vis-canvas-' + this.id
      var htmlString = '<div style="height:100%" id="' + this.viscanvasId + '"/><//div>'
      this.html = htmlString;
      if (!this.raw) {
        this.raw = {}
      }
      if (!this.raw.nodes || !this.raw.edges){
        var DataObject = await this.getData()
      } else {
        var self = this
        var nodes = self.raw.nodes.map(function(node){
          var temp = node;
          temp.id = temp._id
          return temp
        })
        var DataObject = {nodes: self.raw.nodes, edges: self.raw.edges}
      }

      var nodeArray, edgeArray
      nodeArray = DataObject.nodes
      edgeArray = DataObject.edges

      var nodes = new vis.DataSet(nodeArray)  
      var edges = new vis.DataSet(edgeArray)
      var self = this;
      nodes.on('*', function (action,obj) {            
           self.updateRaw(self,'node');
       });
      edges.on('*', function (action,obj) {          
           self.updateRaw(self,'edge');
       })

  var container = this.domNode.querySelector('#' + this.viscanvasId)
  this.data = {
    nodes: nodes,
    edges: edges
  }

  this.options = {
  interaction:{hover:true},

  manipulation: {
    enabled: false,
    addEdge: this.visAddEdge,
    addNode: this.visAddNode,
    editEdge: this.visEditEdge,
    deleteNode: this.visDeleteNode,
    deleteEdge: this.visDeleteEdge
  },

  physics:{
    enabled: false,
    repulsion: {
      centralGravity: 0.5,
      springLength: 200,
      springConstant: 0.05,
      nodeDistance: 100,
      damping: 0.09
    },
    maxVelocity: 50,
    minVelocity: 0.1,
    solver: 'repulsion',
    stabilization: {
      enabled: true,
      iterations: 2500,
      updateInterval: 10,
      onlyDynamicEdges: false,
      fit: true
    },
        timestep: 0.5,
        adaptiveTimestep: true
  },
  layout: {
    hierarchical: {
      enabled:false
    },
    randomSeed: 1,
    improvedLayout:true
  }
}


  this.network = await new vis.Network(container, this.data, this.options);

  this.network.fit()

  this.options.physics.enabled = true
  this.network.setOptions(this.options)

  this.singleClickListener(this)
  this.doubleClickListener(this)
  this.longClickListener(this)
  this.hoverListener(this)
  this.blurListener(this)
  this.rightClickListener(this)
  this.dragStartListener(this)
  this.dragListener(this)
  this.dragEndListener(this)

  }
   singleClickListener(self) {
    var network = this.network;
    var hand = $world.hands[0]
    network.on("click", function (params) {
      var node = params.nodes[0]
      if(!node){
        return
      }
    })
  }
  showTooltip(obj, blur) {
    var container = this.domNode.querySelector('#' + this.viscanvasId)
    var nodeDelete = this.domNode.querySelector('#tooltipNode');
    if(nodeDelete){
       container.removeChild(nodeDelete);   
       if(blur){
           return;
       }
    }
    var tt = document.createElement("div");
    tt.setAttribute("id", "tooltipNode");
    tt.setAttribute("class", "tooltipNode");
    this.setTTStyle(tt)

    var title = ( obj.tt == undefined ) ? ""  : obj.tt;
    tt.innerHTML = title;
    container.appendChild(tt);
  }
  hoverListener(self) {
     this.network.on("hoverNode", function (params) {         
        var HOVER_SIZE_ICON = 50;
        var nodeId = params.node;
        var node = self.data.nodes.get(String(nodeId).split('_cluster')[0]);//If cluster, display inner node tooltip
        self.showTooltip(node); 

    });
  }  
  setTTStyle(tt) {  
    tt.setAttribute("style","position: absolute;\
	   text-align: left;\
	   top: 5%;\
    left: 20px;\
    background-color: #FFFFFF;\
    font-family: Roboto, Ubuntu, Verdana, Arial;\
    font-size: 0.65em;\
    padding: 5px;\
    border-radius: 5px;\
    border: solid 4px;\
    min-width: 0px;\
    max-width: 50%;\
    min-height: 0px;\
    max-height: 80%;")
  }
  blurListener(self){
    var network = this.network;
    network.on("blurNode", function (params) {      
      var node = self.data.nodes.get(params.node);
      self.hideTooltip();
    });
  }
  hideTooltip(){
    var container = this.domNode.querySelector('#' + this.viscanvasId)
    var nodeDelete = this.domNode.querySelector('#tooltipNode');
    if(nodeDelete){
        container.removeChild(nodeDelete);    
    }
  }
  longClickListener(self) {
    var network = this.network;
    network.on("hold", function (params) {      
      var node = params.nodes[0]
      var msg = self.addNode(node,params,self)
      self.sendBroadcast({msg})
    })
  }
  doubleClickListener(self) {
    var network = this.network;
    network.on("doubleClick", async function (params) {

        var nodeId = params.nodes[0]
        var node = self.data.nodes.get(nodeId)
        var editor = $world.get('NodeEditor')
            if (!editor){                         
              editor = await loadObjectFromPartsbinFolder("NodeEditor");
              editor.openInWorld();
            }
            editor.node = node
            editor.saveTarget = self         
            editor.get('container').makeFields(node)            
            editor.bringToFront();
    })
  }
  rightClickListener(self) {
    var network = this.network;
    network.on("oncontext", function (params) {
    })
  }
  dragStartListener(self){
    var network = this.network;
    network.on("dragStart", function (params) {          
    })
  }
  dragListener(self){
    var network = this.network;
    network.on("dragging", function (params) {
    })
  }
  dragEndListener(self){
    var network = this.network;
    network.on("dragEnd", function (params) {      
    })
  }
  visAddEdge(data,callback) {    
    var self = this
    $world.get('CategoryVisualization').get('visjsMorph').sendBroadcast({msg: {edge: data, objectType: 'edge', type: 'edit'}})
    callback(data);    
  }
  visAddNode(data,callback) {
    callback(data)
  }
  visEditEdge(data,callback) {
    var msg = {edge: data, objectType: 'edge', type: 'edit'}
    $world.get('CategoryVisualization').get('visjsMorph').sendBroadcast({msg})
    callback(data)
  }

  visDeleteNode(data,callback){    
    var msg = {node: data, objectType: 'node', type: 'delete'}
    $world.get('CategoryVisualization').get('visjsMorph').sendBroadcast({msg})
    callback(data)
  }

  visDeleteEdge(data,callback){    
    var msg = {edge: data, objectType: 'edge', type: 'delete'}
    $world.get('CategoryVisualization').get('visjsMorph').sendBroadcast({msg})    
    callback(data)
  }

  addNode(node,params,self){
    if(node){
        //duplicate node here
        var nodeObj = self.data.nodes.get(node)
        var tempNode = deepCopy(nodeObj)
        tempNode.label = nodeObj.label + '_1'
        tempNode.id = nodeObj.id + '_1'
        tempNode._id = tempNode.id

        nodeObj = tempNode
        var type = 'copy'
      } else {
        //create node here
        var nodeCount = self.data.nodes.length + 1
        var {x,y} = params.pointer.canvas
        var nodeObj = {id: String(nodeCount), label: 'Node ' + nodeCount, tt: 'Node ' + nodeCount, x: x, y: y}
        nodeObj._id = nodeObj.id       

        var type = 'new'
      }
      self.data.nodes.update(nodeObj)
      return {node: nodeObj, objectType: 'node', type: type}
  }
  onResize(evt) {

  }
  makeTextField(k,v) {

