  getClusterByData(self,nodeId,node,group) {
    return {
              joinCondition:  function(childOptions){
                return (childOptions.group == group)},
              clusterNodeProperties: {
                id: node.id + '_cluster',
                label: 'Cluster of Grouping: \n' + group,
                tt: 'Cluster of Grouping: <br>' + group,
                borderWidth:3,                
                image: node.image,
                shape: node.shape
                }
          };
  }

  async getInstructions(cb) {
    var instructionText = await new WebDAVResource('https://raw.githubusercontent.com/m-hemmings/MiscFiles/master/lively.next/instructions_visjs.html').read()    
    cb(String(instructionText))
  }
  updateRaw(self,author) {

    var nodes = self.data.nodes
    var edges = self.data.edges    
    if (!self.raw){
      self.raw = {}
    }
    var nodeArray = [],
    edgeArray = []
    nodes.forEach(function(node){
      nodeArray.push(node)
    })
    edges.forEach(function(edge){      
      edgeArray.push(edge)
    })
    self.raw.nodes = nodeArray
    self.raw.edges = edgeArray    
  }
  resetData() {
    this.data.raw = {nodes: null, edges: null}
  }
  setupL2L(){
    var client = L2LClient.default()
    var self = this

    client.addService("CollabMessage",(tracker,msg,ackFn,sender)=>{      
      if(msg.data.type == 'ping'){        
        var [outmsg,ackFn] = self.client.prepareSend({target: sender, action: "CollabMessage", data: "pong"},(ans)=>{})
        self.client.sendTo(msg.data.id,'CollabMessage',{type: 'pong', id:self.client.id})
      }

      if(msg.data.type == 'pong'){
        if (!self.clientList){
          self.clientList = []
        }
        self.clientList.push(msg.data.id)        
      }

      if(msg.data.node){        
        if(msg.data.type == 'delete'){
          var nodes = msg.data.node.nodes
          var edges = msg.data.node.edges
          nodes.forEach(function(ea){
            self.data.nodes.remove(ea)
          })
          edges.forEach(function(ea){
            self.data.edges.remove(ea)
          })
        } else {
          self.data.nodes.update(msg.data.node)
        }

      }
      if(msg.data.edge){
        if(msg.data.type == 'delete'){
          var nodes = msg.data.edge.nodes
          var edges = msg.data.edge.edges
          nodes.forEach(function(ea){
            self.data.nodes.remove(ea)
          })
          edges.forEach(function(ea){
            self.data.edges.remove(ea)
          })
        } else {
          self.data.edges.update(msg.data.edge)
        }       

      }
    })
    client.sendTo(client.trackerId,"joinRoom", {roomName: "visRoom"}, (ans)=>{ })
    this.client = client
  }
  sendBroadcast(options) {
    var self = this;
    var opts = {
      client: self.client,
      roomName: "visRoom",
      msg: undefined,
      tracker: self.client.trackerId,
      ackFn: (ans)=>{console.log(ans)},
      ...
      options
    }

    var {client,roomName,msg,tracker,ackFn} = opts    
    var [outmsg,ackFn] = client.prepareSend({target: client.id, action:"CollabMessage",data: msg},(ans)=>{})
    client.sendTo(tracker,"broadcast", {broadcastMessage: outmsg, roomName: roomName}, ackFn)
  }
  async checkRoom(roomName) {
    var me  = await L2LClient.default()    
    var tracker = me.trackerId
    var response = await  me.sendToAndWait(tracker,'listRoom',{roomName})
    return response
  }
  async getState(roomName,num) {
      this.clientList = []
      var client = this.client
      var msg = {type: "ping", id: client.id},
      clients = [],
      Fn = (ans) => { },
      client = this.client
      var [outmsg,ackFn] = client.prepareSend({target: client.id, action: "CollabMessage", data: msg},Fn)
      var ans = await client.sendToAndWait(client.trackerId,"broadcast", {broadcastMessage: outmsg, roomName: roomName},ackFn)      
  }
  clientListLength(len) {
    var self = this;
    if (!this.clientList) { return false}
    if ((this.clientList) && this.clientList.legnth == (len-1)){      
      return true
    }
  }
}
